import React from 'react'
import './Home.css'
import { Navbar,Hero,Product,Gallery,Service,Banar,Footer } from '../../section/Index';

const Home = () => {
  return (
    <>
    <Hero/>
    <Gallery/>
    <Service/>
    <Banar/>
    <Product DataP = {DataP}  ForlopCategory = {ForlopCategory} CategoryByButton = {CategoryByButton} SearchPru={SearchPru}/>
     
    </>
  )
}

export default Home
